import Navbar from '../Navbar/Navbar';
import Login from'../Login/Login'
import RootReducer from '../Store'

function Logout(){
    const haldleout=()=>{
        {!RootReducer&&Login ? <Login/> :<Navbar/>}

    }
    return(
        <div>
          <button onClick={haldleout}>logout</button>

        </div>
    )
}

export default Logout
